import './App.css';
import Logo from './Logo';
import { useState } from 'react'
import Buscar from './Buscar';
import Sesion from './Sesion';
import Products from './Products';


const muestra = [
  {
      "id": Math.random(),
      "name": "Producto no encontrado",
      "price": "",
      "description": "Prueba con otro nombre",
      "photo": "https://lh3.googleusercontent.com/QhiW8DnLTduWospoOfPndFKhdiNKvV0QPttH46skUN7eBh64jmTtcW7OBVnPwn9Uyg5c57M=s88",
      "idUser": Math.random,
      "buyerId": null,
      "createdAt": "2022-01-04T23:00:00.000Z",
      "modifiedAt": null
  }
]

function PaginaPricipal() {
  const [search, setSearch] = useState('')
  const [show, setShow] = useState(false)
  const [user, setUser] = useState('')
  console.log(user, search)
  return (
    <div className="App">
      <header className="header">
       <Logo />
       <Buscar setSearch={setSearch} />
       <Sesion show={show} setShow={setShow} setUser={setUser} />
      </header>
      <aside className='aside'>

      </aside>
      <main className='main'>
        {search ? <Products products={search}/> : muestra.map(product =>
        <div key={product.id} className='product'>
            <img src={`http://localhost:3000${product.photo.replace('./', '/')}`} alt={product.name} className='photo'/>
            <div className='content'>
                <h1>{product.name}</h1>
                <div className='description'>
                    <p>{product.description}</p> <span>{product.price}</span>
                </div>
            </div>
        </div>)}
      </main>
      <footer className='footer'>+

      </footer>
    </div>
  );
}

export default PaginaPricipal;
